Milano è un server RolePlay ambientato nella città Italiana di Milano. 

La mappa ROBLOX è ancora in fase di sviluppo ma potrai osservare gli spoiler in spoilers del server Discord.

Potrai entrare nelle seguenti istituzioni:

・Polizia di Stato;
・Arma dei Carabinieri;
・Vigili del Fuoco;
・Protezione Civile;
・Croce rossa Italiana;

Inoltre potrai aprire una azienda tutta tua!

Che aspetti entra su Milano: [Clicca](https://discord.gg/milano22)

